#include <iostream>
#include <vector>
#include <set>
#include <algorithm>

using namespace std;

const int MAX_N = 27;
const int MAX_M = 9;

int N, M;
int T[MAX_N][3][3];
int F[MAX_N][3][3];
int R[MAX_N][3][3];

void solve(int n, int m) {
    if (n == 0) {
        int sum = 0;
        for (int i = 0; i < 3; i++) {
            for (int j = 0; j < 3; j++) {
                sum += R[m][i][j];
            }
        }
        set<int> s;
        s.insert(sum);
        for (int i = 0; i < 3; i++) {
            for (int j = 0; j < 3; j++) {
                if (R[m][i][j] == 0) {
                    for (int k = 1; k <= 6; k++) {
                        R[m][i][j] = k;
                        solve(n - 1, m + 1);
                        R[m][i][j] = 0;
                    }
                }
            }
        }
        if (s.size() > 0) {
            vector<int> v(s.begin(), s.end());
            sort(v.begin(), v.end());
            for (int i = 0; i < v.size(); i++) {
                if (i > 0) cout << " ";
                cout << v[i];
            }
            cout << endl;
        }
    } else {
        for (int i = 0; i < 3; i++) {
            for (int j = 0; j < 3; j++) {
                if (T[n][i][j] == 0) {
                    for (int k = 1; k <= 6; k++) {
                        T[n][i][j] = k;
                        solve(n - 1, m);
                        T[n][i][j] = 0;
                    }
                }
            }
        }
    }
}

