                }
            }
        }
        for (int i = 0; i < N; i++) {
            for (int j = 0; j < 3; j++) {
                for (int k = 0; k < 3; k++) {
                    if (F[i][j][k] == 0) {
                        for (int l = 1; l <= 6; l++) {
                            if (T[i][j][k] + l == 7) {
                                R[i][j][k] = l;
                                break;
                            }
                        }
                    }
                }
            }
        }
        solve(N, 0);
    }
    return 0;
